class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& bo) {
        vector<pair<long long,pair<int,int>>> v;
        long long ans=-1e10;
        int n=bo.size();
        int m=bo[0].size();
        for(int i=0; i<n; i++){
            for(int j=0; j<m; j++){
                v.push_back({bo[i][j],{i,j}});
            }
        }
        sort(v.rbegin(),v.rend());

        for(int i=0; i<v.size(); i++){
            int x=v[i].second.first;
            int y = v[i].second.second;
            for(int j = i+1; j<v.size(); j++){
                int f=0;
                int p = v[j].second.first;
                int q = v[j].second.second;
                if(p==x || q==y) continue;
                for(int k= j+1; k<v.size(); k++){
                    int r =v[k].second.first;
                    int t = v[k].second.second;
                    if(r==x || r==p || t==y || t==q) continue;
                    long long temp = v[i].first + v[j].first + v[k].first;
                    if(temp>ans) ans = temp;
                    break;
                }

            }
        }
        return ans;
    }
};
